import React from 'react'
import { StyleSheet, Text, View } from 'react-native'

const initialScreen = () => {
    return (
        <View>
            <Text>This is a initial Screen! D:</Text>
        </View>
    )
}

export default initialScreen

const styles = StyleSheet.create({})
